import React from "react"
import "./Menu.css"

function Menu(){
    return (
        <div className="Menu">
            <a href="#">Главная</a>
            <a href="#">Магазин</a>
            <a href="#">Отзывы</a>
            <a href="#">Доставка</a>
        </div>
    )
}


export default Menu
